Départ pour Crater Lake, le temps est toujours très gris. On remonte un pau vers Eugene pour y faire le plein d’essence car elle est 20cts moins chère. Au fur et à mesure que l’on descend vers le Sud le temps s’amèliore jusqu’à un beau soleil mais qui est vite caché par de la fumée, il doit y avoir des feux ici aussi, décidement. On tente de rentrer dane le parc de Crater Lake vers le Nors mais l’accès est fermé en raison des incendies, on décide de continuer malgrè la fumée et l’entrée Ouest est ouverte. On se dirige au Visitor Center qui nous confirme que la moitiè des routes sont fermées mais devrait réouvrir demain. De ce coté ci il n’y a pas trop de fumée et on décide d’aller au camping du State Parc pour deux nuits. En raison des restrictions d’eau, il n’ a ni eau ni Dump. Ca va être dur de tenir. Par contre nous avons de l’electricité moyennant 4$/jour en supplément.
On monte sur le cratère et on découvre cet immense lac de 10X8 Kms d’une profondeur de 647 mètres. Nous assistons à un cours d’une Rangers qui nous explique tout le processus qui a amené à l’effondrement des volcans;
Je fais un petit trail « Garfield Peak » sur la caldera de 5,8 Kms +308 mètres qui permet d’arriver à un poit haut offrant une très belle vue sur le lac mais la fumée gâche un peu la vue et rend la respiration un peu difficile. Pendant le trail je rencontre un française installé à New York avec un américain, nous parlons quelques minutes de voyage et des différents Parcs.

Nuit très calme au bivouac, le remps est couvert et gris. Nous reprenons la route et nous nous arrêtons à **Bodie Ghost Town** ancienne ville créee grâce à la rué vers l’or et qui est morte petit à petit l’or se raréfiant et surtout en raison d’un incendie qui ravage la ville en 1932. 100 millions de $ y ont été extrait. Le dernier habitant à quitté la ville en 1940. Les survivants de l’époque ont crées un parc en 1962 pour la mémoire;
Ensuite nous repartons en direction de Mono Lake, encore une zone à forte activité volcanique. De nombreux, anciens volcans, se trouve dans et autour du lac. L’activité géothermique a crée de nobreuse cheminée dans le lac. L’eau du baissant, ces cheminée de Tuff ont fait surface. Nous nous arrêtons au nord du lac à «County Park» puis faisons un arrêt au visitor center avant de contourner le parc pour faire un trail à «South Tufa» Malheueusement le temps est couvert et nous n’aurons pas droit à un beau coucher de soleil sur le lac.
Nous trouvons un bivouac dans les pins à quelques kilomètre de parc.
